import React from 'react'
import { Row,Card,Col,Button} from 'react-bootstrap'
import{respuesta} from 'App.js'

const requestTarget =document.querySelector('#request-target');
const itemContainer = document.querySelector('#item-container');
const IntersectionObserver ={
 therhold: 3
}
let apiURL = respuesta;
// let loading =false;

const onIntersect =([entry])=>{
  console.log(entry);

}
// ,IntersectionOptions
let observer = new IntersectionObserver(onIntersect);
observer.observe(requestTarget);



const Presionar=()=>{
  console.log('Presionar Charlie');
}


export default function  Incio({data}){
  return (
              <div>
                       <br></br>
                       <div>
                       <h1>API START WARS</h1>  
                       </div>
                      <h3 className="card-title">Personajes</h3>
                      <h  className="card-text" >Lista de Personajes</h>

                       <br/>
                       <br/> 
                      <div className="container">
                                <Row xs={1} md={3} className="g-4">
                                {data.map((personaje,i)=>{
                                        return(
                                          <Col key={i} className='item-container' id="item-container">
                                          <Card id="request-target">
                                            <Card.Img variant="top" src="./start_wars.jpg"/>
                                            <Card.Body>
                                              <Card.Title><h1>{personaje.name}</h1></Card.Title>
                                              <Card.Text>Altura: { personaje.height} </Card.Text>
                                              <Card.Text>Peso: { personaje.mass} </Card.Text>
                                              <Card.Text>Fecha Nacimiento: { personaje.birth_year} </Card.Text>
                                              <Button variant="primary" onClick={Presionar}>
                                                Agregar a Favoritos
                                                </Button>
                                            </Card.Body>
                                          </Card>
                                        </Col>
                                          )
                                        })} 




                                </Row>



                      </div>
              </div>
          )



}
